const getFullname = (firstName, secondName, thirdName) => {
    return firstName + "" + secondName + "" + thirdName;
}

export function Cat() {
    return (
        <Text>
            I am {getFullname("Rum", "Tum", "Tugger")}!
        </Text>
    );
}
